import React from 'react';
import { CountdownCircleTimer } from 'react-countdown-circle-timer'
import Clock from 'react-digital-clock';

const App = () => {
    return (
        <>
            <Clock />
            <h1>Hello I am akalesh tanwer</h1>
            <CountdownCircleTimer
                isPlaying
                duration={100}
                colors={[
                    ['#004777', 0.33],
                    ['#F7B801', 0.33],
                    ['#A30000', 0.33],
                ]}
            >
                {({ remainingTime }) => remainingTime}
            </CountdownCircleTimer>
        </>
    );
};

export default App;
